    /**
     * Gets the attribute value for NOC_DATE_ACTUAL using the alias name NocDateActual.
     * @return the NOC_DATE_ACTUAL
     */
    public Date getNocDateActual() {
        java.util.Date uDate = new java.util.Date();
        Date enteredDate = this.getNocDateEntered();
        String nocBy = this.getNocBy(); 
        if(nocBy!=null && "BY_LESSOR".equals(nocBy) && enteredDate!=null){
            Calendar c = Calendar.getInstance(); 
            c.setTime(enteredDate); 
            c.add(Calendar.DATE, 4);
            uDate = c.getTime(); 
            java.sql.Date actualDate = new java.sql.Date(uDate.getTime());
            return actualDate;
        }else{
            return enteredDate;
        }
//        return (Date) getAttributeInternal(NOCDATEACTUAL);
    }

